const axios = require("axios");

const API_URL =
  "https://mobile-services-92086589662.us-central1.run.app/CountryCodes";

export const fetchCountryCodes = async () => {
  try {
    const response = await axios.post(API_URL, {
      user: "Admin",
      password: "GenAI@7070",
      token: "GenAI-CountryCodes",
    });

    return response.data.data; // Returning the array of country codes
  } catch (error) {
    console.error("Error fetching country codes:", error);
    return [];
  }
};
